import React, {useState, useEffect} from 'react'
import {useHistory, Link, useParams} from "react-router-dom"

const Workspace = () => {
    const [loadedOther, setLoadedOther] = useState(false)
    const [loadedSelf, setLoadedSelf] = useState(false)
    const [workspace, setWorkspace] = useState()
    const workspaceID = useParams().id;

    useEffect(() => {
        const fetchData = async () => {
            try {
                const workspace = await workspacesAPI.get(`/${workspaceID}`);

                setWorkspace(workspace.data.data);

                if (workspace.data.other) {
                    setLoadedOther(true);
                } else {
                    setLoadedSelf(true);
                }
            } catch (err) {}
        }
        fetchData();
    }, [])

    return (
        <>
            {loadedOther &&
                <div className="width-body">  

                </div>
            }
            {loadedSelf &&
                <div className="sidebar-body">  

                </div>
            }
        </>
    )
}

export default Workspace
